// Name: Tab Paint
// ID: tabpaint
// Description: Change the tab's favicon and title!
// By: RBryanYT <https://scratch.mit.edu/users/a_Gameer0438791>
// License: MIT

Scratch.translate.setup(
  {"es":
    {
      "_Tab Paint must run unsandboxed!": " ",
      "_Tab Paint": " ",
      "_set tab title to [TITLE]": " ",
      "_set tab favicon to link [LINK]": " "
    }
  }
);

(function(Scratch) {
  const vm = Scratch.vm;

  'use strict';

  if (!Scratch.extensions.unsandboxed) {
    throw new Error(Scratch.translate("Tab Paint must run unsandboxed!"));
  }
  
  const logo = "data:image/png;base64,"
  
  class TabPaint {
    getInfo() {
      return {
        id: 'tabpaint',
        name: Scratch.translate("Tab Paint"),
        color1: "#b5b5b5",
        color2: "#9e9e9e",
        color3: "#848484",
        menuIconURI: logo,
        blocks: [
          {
            opcode: 'setTitle',
            blockType: Scratch.BlockType.COMMAND,
            text: Scratch.translate("set tab title to [TITLE]"),
            arguments: {
              TITLE: {
                type: Scratch.ArgumentType.STRING
              }
            }
          },
          {
            opcode: 'setFavicon',
            blockType: Scratch.BlockType.COMMAND,
            text: Scratch.translate("set tab favicon to link [LINK]"),
            arguments: {
              LINK: {
                type: Scratch.ArgumentType.STRING
              }
            }
          }
        ]
      };
    }
  
    setTitle(args) {
      document.title = args.TITLE;
    }

    setFavicon(args) {
      var existingLink = document.querySelector('link[rel="icon"]');
      if (existingLink) {
        document.head.removeChild(existingLink);
      }

      var iconSet = document.createElement('link');
      iconSet.rel = 'icon';
      iconSet.type = 'image/png';
      iconSet.href = args.LINK;
      document.head.appendChild(iconSet);
    }
  }
  Scratch.extensions.register(new TabPaint());
})(Scratch);